//Dependencies
import { TiltValueInterface } from "./helperInterfaces";

export const generateTiltValues : () => TiltValueInterface = () => {
    const tiltValues : TiltValueInterface = {
        rotation : -3,
        skew : 0
    };

    return tiltValues;
};
